import React from 'react';
import '../styles/global.css'; // Reemplaza MaintenanceTable.css

const MaintenanceTable = ({ data, showTechnician }) => {
    return (
        <div className="table-container">
            <table className="resident-table">
                <thead>
                <tr>
                    <th>Residente</th>
                    <th>Fecha</th>
                    <th>Asunto</th>
                    <th>Descripción</th>
                    {showTechnician && <th>Estado</th>}
                    {showTechnician && <th>Técnico Asignado</th>}
                    <th>Acciones</th>
                </tr>
                </thead>
                <tbody>
                {data.map((request) => (
                    <tr key={request.id}>
                        <td>{request.residente}</td>
                        <td>{request.fecha}</td>
                        <td>{request.asunto}</td>
                        <td>{request.descripcion}</td>
                        {showTechnician && (
                            <td>
                                    <span
                                        className={`type-badge ${
                                            request.estado === 'En Progreso'
                                                ? 'badge-in-progress'
                                                : request.estado === 'Completado'
                                                    ? 'badge-completed'
                                                    : 'badge-cancelled'
                                        }`}
                                    >
                                        {request.estado}
                                    </span>
                            </td>
                        )}
                        {showTechnician && <td>{request.tecnicoAsignado}</td>}
                        <td>
                            <button className="view-btn">Ver Detalles</button>
                            <button className="delete-btn">Cancelar</button>
                        </td>
                    </tr>
                ))}
                </tbody>
            </table>
        </div>
    );
};

export default MaintenanceTable;
